import React, { useState } from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import './App.css';
import FacultyPopup from './components/FacultyPopup'; // Import the FacultyPopup component

function CustomNavbar() {
  const [showPopup, setShowPopup] = useState(false);

  return (
    <Navbar expand="lg" bg="light" variant="light">
      <Container>
        <Navbar.Brand href="#home">QUEST | Nawabshah</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <div className="nav-item" onMouseEnter={() => setShowPopup(true)} onMouseLeave={() => setShowPopup(false)}>
              <span className="nav-link">Faculties</span>
              {showPopup && <FacultyPopup />}
            </div>
            {/* Add more nav items as needed */}
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default CustomNavbar;
